import { Avatar, AvatarFallbackText, AvatarImage, Button, HStack, Heading, VStack, Image, Text, View, Box, ButtonText, ButtonIcon, ChevronRightIcon, Switch } from "@gluestack-ui/themed";
import React, { useEffect, useState } from "react";
import * as ImagePicker from 'expo-image-picker';
import { getAuth, signOut} from 'firebase/auth';
import { getStorage, ref, uploadBytes } from 'firebase/storage';
import { TouchableOpacity } from "react-native";

const Settings = () => {

  const logout = async () => {
    const auth = getAuth();
    try {
      await signOut(auth);
      // Aquí podrías navegar a otra pantalla o hacer cualquier otro manejo necesario después de cerrar sesión
    } catch (error) {
      console.error('Error al cerrar sesión:', error);
    }
  };

  return (
    <VStack
        flex={1}
        space="lg"
        backgroundColor="#EFEFEF">

        <View
            mx={"$8"}
            marginTop={"$12"}
            alignItems="center"
            borderRadius={"$3xl"}
            backgroundColor="white"
            style={{
                shadowColor: "black",
                shadowOffset: {
                    width: 0,
                    height: 6,
                },
                shadowOpacity: 0.25,
                shadowRadius: 4,
                elevation: 8,
            }}>
            <Heading
                w={"$72"}
                marginTop={"$4"}
                fontSize={"$2xl"}>
                Profile
            </Heading>
            <Image
                source={{
                    uri: "https://media.vanityfair.com/photos/5ba12e6d42b9d16f4545aa19/3:2/w_1998,h_1332,c_limit/t-Avatar-The-Last-Airbender-Live-Action.jpg",
                }}
                style={{
                    height: 100,
                    width: 100,
                    borderRadius: 100,
                }}>
            </Image>
            <Text marginTop={"$3"} fontWeight="$semibold" fontSize={"$2xl"}> Username </Text>
            <Text marginTop={"$3"} marginVertical={"$6"}> Email@example.com </Text>
        </View>

        <View
            mx={"$8"}
            alignItems="center"
            borderRadius={"$3xl"}
            backgroundColor="white"
            style={{
                shadowColor: "black",
                shadowOffset: {
                    width: 0,
                    height: 6,
                },
                shadowOpacity: 0.25,
                shadowRadius: 4,
                elevation: 8,
            }}>
            <Heading
                w={"$72"}
                marginTop={"$4"}>
                Configuration
            </Heading>

            <Box
                position="relative"
                alignItems="center"
                justifyContent="center"
                marginTop={"$1"}
                width={"100%"}>
                <Button
                    w={"$72"}
                    flexDirection="row"
                    alignItems="center"
                    px={"$0"}>
                    <Image source={require("../assets/Person.png")} size="xs" mr={"$2"} />
                    <ButtonText
                        fontSize={"$lg"}
                        marginLeft={"$2"}
                        fontWeight="$normal"
                        color="black">
                        Personal information
                    </ButtonText>
                    <ButtonIcon
                        alignItems="flex-end"
                        ml={"$5"}
                        size="xl"
                        as={ChevronRightIcon}
                        marginLeft={"auto"}
                        color="black" />
                </Button>
            </Box>

            <Box
                position="relative"
                alignItems="center"
                justifyContent="center"
                marginTop={"$1"}
                width={"100%"}>
                <Button
                    w={"$72"}
                    flexDirection="row"
                    alignItems="center"
                    justifyContent="space-between"
                    px={"$0"}>
                    <Image source={require("../assets/MagneticCard.png")} size="xs" mr={"$2"} />
                    <ButtonText
                        fontSize={"$lg"}
                        marginLeft={"$2"}
                        color="black"
                        fontWeight="$normal">
                        Payment method
                    </ButtonText>
                    <ButtonIcon
                        alignItems="flex-end"
                        ml={"$5"}
                        size="xl"
                        color="black"
                        as={ChevronRightIcon}
                        marginLeft={"auto"} />
                </Button>
            </Box>

            <Box
                position="relative"
                alignItems="center"
                justifyContent="center"
                marginTop={"$1"}
                width={"100%"}
                px={"$0"}>
                <Button
                    w={"$72"}
                    flexDirection="row"
                    alignItems="center"
                    justifyContent="space-between"
                    px={"$0"}>
                    <Image source={require("../assets/UserShield.png")} size="xs" mr={"$2"} />
                    <ButtonText
                        fontSize={"$lg"}
                        marginLeft={"$2"}
                        color="black"
                        fontWeight="$normal">
                        Privacity
                    </ButtonText>
                    <ButtonIcon
                        alignItems="flex-end"
                        ml={"$5"}
                        color="black"
                        size="xl"
                        as={ChevronRightIcon}
                        marginLeft={"auto"} />
                </Button>
            </Box>

            <Box
                position="relative"
                alignItems="center"
                justifyContent="center"
                marginTop={"$1"}
                marginBottom={"$2"}
                width={"100%"}>
                <Button
                    w={"$72"}
                    flexDirection="row"
                    alignItems="center"
                    justifyContent="space-between"
                    px={"$0"}>
                    <Image source={require("../assets/Help.png")} size="xs" mr={"$2"} />                    
                    <ButtonText
                        fontSize={"$lg"}
                        marginLeft={"$2"}
                        color="black"
                        fontWeight="$normal">
                        Help
                    </ButtonText>
                    <ButtonIcon
                        alignItems="flex-end"
                        ml={"$5"}
                        color="black"
                        size="xl"
                        as={ChevronRightIcon}
                        marginLeft={"auto"} />
                </Button>
            </Box>
        </View>
        <View
            mx={"$8"}
            alignItems="center"
            borderRadius={"$3xl"}
            backgroundColor="white"
            style={{
                shadowColor: "black",
                shadowOffset: {
                    width: 0,
                    height: 6,
                },
                shadowOpacity: 0.25,
                shadowRadius: 4,
                elevation: 8,
            }}>
            <Heading
                w={"$72"}
                marginTop={"$4"}>
                Preferences
            </Heading>

            <Box
                position="relative"
                alignItems="center"
                justifyContent="center"
                marginTop={"$1"}
                width={"100%"}>
                <Button
                    w={"$72"}
                    flexDirection="row"
                    alignItems="center"
                    justifyContent="space-between"
                    $active-bgColor="white"
                    px={"$0"}>
                    <Image source={require("../assets/Doorbell.png")} size="xs" mr={"$2"} />                    
                    <ButtonText
                        fontSize={"$lg"}
                        marginLeft={"$2"}
                        color="black"
                        fontWeight="$normal">
                        Notification
                    </ButtonText>

                    <Switch
                        alignItems="flex-end"
                        marginLeft={"auto"}
                        size="md"
                        isDisabled={false} />

                </Button>
            </Box>

            <Box
                position="relative"
                alignItems="center"
                justifyContent="center"
                marginTop={"$1"}
                width={"100%"}>
                <Button
                    w={"$72"}
                    flexDirection="row"
                    alignItems="center"
                    justifyContent="space-between"
                    px={"$0"}>
                    <Image source={require("../assets/BoxImportant.png")} size="xs" mr={"$2"} />                    
                    <ButtonText
                        fontSize={"$lg"}
                        marginLeft={"$2"}
                        color="black"
                        fontWeight="$normal">
                        FAX
                    </ButtonText>
                    <ButtonIcon
                        alignItems="flex-end"
                        ml={"$5"}
                        color="black"
                        size="xl"
                        as={ChevronRightIcon}
                        marginLeft={"auto"} />
                </Button>
            </Box>

            <Box
                position="relative"
                alignItems="center"
                justifyContent="center"
                marginTop={"$1"}
                marginBottom={"$2"}
                width={"100%"}>
                <Button
                    w={"$72"}
                    flexDirection="row"
                    alignItems="center"
                    justifyContent="space-between"
                    px={"$0"}>
                    <Image source={require("../assets/Logout.png")} size="xs" mr={"$2"} />
                    <ButtonText
                        fontSize={"$lg"}
                        marginLeft={"$2"}
                        color="#BFA27E">
                        Logout
                    </ButtonText>
                    <ButtonIcon
                        alignItems="flex-end"
                        ml={"$5"}
                        size="xl"
                        color="#BFA27E"
                        as={ChevronRightIcon}
                        marginLeft={"auto"} />
                </Button>
            </Box>

        </View>
    </VStack>

  );
};

export default Settings;
